import { createApp } from 'vue'
import App from './App.vue'
//导入路由
import router from "@/router";
//导入evenBus
import bus from "@/util/Bus";
//导入Bootstrop-icon
import iconPath from 'bootstrap-icons/bootstrap-icons.svg'


const app = createApp(App);


app.use(router)
app.use(bus)
app.use(iconPath)

app.mount('#app')
